import Stocktracker from './Stocktracker'
import FinanceSlider from './FinanceSlider';




const Finance = () => {
    return (  
        <div className="finance-page">  
          <Stocktracker />
          <div className="finance-first-block">
              <div className="finance-top-news">
                 <FinanceSlider />
                 
              </div>
             
          <div className="msb-iframe">
        
            <iframe src="https://www.malaysiastock.biz/Mini-Market-Watch.aspx" width="300" height="500" frameborder="0" scrolling="no"></iframe>


        
          </div>

          </div>
          

      </div>
    );
}
 
export default Finance;
